import { Stack, Heading, Flex } from "@chakra-ui/react";
import Message from "../components/Message";

const Conversation = () => {
  return (
    <Flex flexDirection='column' gap='10px' w='100%'>
          <Message />
          <Message isUser='true'/>
        </Flex>
  );
};

export default Conversation;
